import React from 'react';
const Why = ()=> (
  <section className="section fade-up">
    <h3 className="text-2xl font-bold mb-4">Why we care</h3>
    <p className="text-gray-300 mb-4">We believe tech should lift people. By focusing on smaller cities, we bring solutions where they matter most — helping shop owners get clarity, reduce waste, and grow their income.</p>
    <div className="grid md:grid-cols-3 gap-6">
      <div className="card"><h4 className="font-semibold text-white">Empathy</h4><p className="text-gray-300">Design that respects the user's time and knowledge.</p></div>
      <div className="card"><h4 className="font-semibold text-white">Practicality</h4><p className="text-gray-300">Tools that do one thing well — no fluff.</p></div>
      <div className="card"><h4 className="font-semibold text-white">Affordability</h4><p className="text-gray-300">Pricing designed for small budgets.</p></div>
    </div>
  </section>
);
export default Why;
